transcript.sparql:
PREFIX up: <http://purl.uniprot.org/core/>
PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>

SELECT ?protein ?sequence
WHERE {
  VALUES ?organism { <http://purl.uniprot.org/taxonomy/1010810> <http://purl.uniprot.org/taxonomy/1110693> <http://purl.uniprot.org/taxonomy/1403831> <http://purl.uniprot.org/taxonomy/1420014> <http://purl.uniprot.org/taxonomy/2821264> <http://purl.uniprot.org/taxonomy/2821265> <http://purl.uniprot.org/taxonomy/2821266> <http://purl.uniprot.org/taxonomy/2821267> <http://purl.uniprot.org/taxonomy/2821268> <http://purl.uniprot.org/taxonomy/316385> <http://purl.uniprot.org/taxonomy/316407> <http://purl.uniprot.org/taxonomy/469008> <http://purl.uniprot.org/taxonomy/511145> <http://purl.uniprot.org/taxonomy/83333> <http://purl.uniprot.org/taxonomy/85962> <http://purl.uniprot.org/taxonomy/96440> }
  ?protein a up:Protein ;
           up:organism ?organism ;
           up:sequence ?seq .
  ?seq rdf:value ?sequence .
}

